import React from 'react';
import './Css/section1.css';

function Section1() {
  return (
    <div className='poster'>
      <img src="../../img/hamburger.jpg" alt="Hamburger" />
      <h1>Le Catering</h1>
    </div>
  );
}

export default Section1;
